import React from 'react';
import './HorizontalNav.css';
import logo from '../../images/logo/logo.png'
import titrelogo from '../../images/logo/titre-logo.png'
const HorizontalNav = () => {
  return (
    <nav className="horizontal-nav">
      <ul>
        <li><img src={logo} alt="logo" className="logo" /></li>
        <li><img src={titrelogo} alt="titre-logo" className="titrelogo" /></li>
        <li>Accueil</li>
        <li>Profil</li>
        <li>Réglage</li>
        <li>Communauté</li>
      </ul>
    </nav>
  );
};

export default HorizontalNav;
